import ViewIndividualRestrictedAuthBlogHelper from "../../../../components/dashboard/blogging/individual/viewIndividualBlog.js";

const ViewIndividualRestrictedAuthBlogPage = (props) => {
    return (
        <Fragment>
            <ViewIndividualRestrictedAuthBlogHelper props={props} />
